script: |
  super -f text -I q991.spq | sort > q991.out

inputs:
  - name: q991.spq
    data: |
      SELECT DISTINCT cor0.col0 + cor0.col0 + col1 / - cor0.col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( col2 + col2 * - cor0.col0 ) NOT BETWEEN NULL AND NULL;
  - name: tab0

outputs:
  - name: q991.out
    data: |
